import React from 'react';
import whiteLogo from '../../styles/images/whiteLogo.png';
import { Input, Button, Typography } from 'antd';
import { AiOutlineUser, AiFillLock } from 'react-icons/ai'
import { InputText } from 'primereact/inputtext';
import 'primereact/resources/primereact.min.css';

const {Title} = Typography

const style = {
    main: {
        display: 'flex',
        height: '100%',
        width: '100%',
        background: '#ff773b'
    },
    divInfo: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
        height: '100%',
        width: '100%'
    },
    sectionInfo: {
        height: '100%',
        width: '100%',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        flexDirection: 'column',
        color: '#ffffff'
    },
    sectionLogin: {
        height: '10%',
        width: '100%',
        display: 'flex',
        justifyContent: 'space-between'
    },
    input: {
        width: '250px',
        height: '29px',
        marginTop: '40px',
        marginRight: '10px',
        marginLeft: '10px'
    }
}

const Login = () => {
    return (
        <main style={style.main}>
            <div style={style.divInfo}>
                <section style={style.sectionLogin}>
                    <div style={{display:'flex', justifyContent:'center', alignItems:'center'}}>
                        <img src={whiteLogo} style={{ marginTop: '8px', height:'75px', width:'150px', marginLeft:'20px' }} alt="CNX Telecom - você sempre conectado!" />
                    </div>
                    <div style={{display:'flex', justifyContent:'center', alignItems:'center', marginRight:'20px'}}>
                        <InputText style={style.input}></InputText>
                        <Input.Password style={style.input} prefix={<AiFillLock/>}></Input.Password>
                        <Button style={{ marginTop: '40px', height: '29px' }}>Entrar</Button>
                    </div>

                </section>
                <section style={style.sectionInfo}>
                    <Title style={{color:'#fff'}}>Gerencie o conteúdo que sera mostrado a seus clientes</Title>
                </section>
            </div>
        </main>
    )
}

export default Login
